import React, { useState } from 'react';
import { useForm } from 'react-hook-form';
import './BookingForm.css'; // Ensure this is correctly linked to your styles

const BookingForm = () => {
  const { register, handleSubmit, formState: { errors } } = useForm();
  const [formSubmitted, setFormSubmitted] = useState(false);

  const onSubmit = (data) => {
    setFormSubmitted(true);
    // Handle the form submission, e.g., send data to API
    console.log(data);
  };

  return (
    <div className="booking-form-container">
      <h2 className="booking-form-title">Car Rescue Booking</h2>
      <form onSubmit={handleSubmit(onSubmit)} className="booking-form">
        <div className="form-group">
          <label>Car Registration Number</label>
          <input 
            type="text" 
            {...register("carRegistration", { required: "Car registration number is required" })}
            className="form-input"
          />
          {errors.carRegistration && <p className="error-message">{errors.carRegistration.message}</p>}
        </div>

        <div className="form-group">
          <label>Car Type</label>
          <input 
            type="text" 
            {...register("carType", { required: "Car type is required" })}
            className="form-input"
          />
          {errors.carType && <p className="error-message">{errors.carType.message}</p>}
        </div>

        <div className="form-group">
          <label>Car Weight</label>
          <input 
            type="number" 
            {...register("carWeight", { required: "Car weight is required", min: 1 })}
            className="form-input"
          />
          {errors.carWeight && <p className="error-message">{errors.carWeight.message}</p>}
        </div>

        <div className="form-group">
          <label>Pickup Location</label>
          <input 
            type="text" 
            {...register("pickupLocation", { required: "Pickup location is required" })}
            className="form-input"
          />
          {errors.pickupLocation && <p className="error-message">{errors.pickupLocation.message}</p>}
        </div>

        <div className="form-group">
          <label>Delivery Location</label>
          <input 
            type="text" 
            {...register("deliveryLocation", { required: "Delivery location is required" })}
            className="form-input"
          />
          {errors.deliveryLocation && <p className="error-message">{errors.deliveryLocation.message}</p>}
        </div>

        <div className="form-group">
          <label>Your Name</label>
          <input 
            type="text" 
            {...register("userName", { required: "Your name is required" })}
            className="form-input"
          />
          {errors.userName && <p className="error-message">{errors.userName.message}</p>}
        </div>

        <div className="form-group">
          <label>Your Phone Number</label>
          <input 
            type="tel" 
            {...register("userPhone", { required: "Your phone number is required" })}
            className="form-input"
          />
          {errors.userPhone && <p className="error-message">{errors.userPhone.message}</p>}
        </div>

        {/* Payment Link */}
        <div className="payment-info">
          <p>Payment of KES 1,500 is required to complete the booking.</p>
          <a 
            href="https://paystack.com/pay/hire-a-flatbed" 
            target="_blank" 
            rel="noopener noreferrer" 
            className="pay-button"
          >
            Pay Now
          </a>
        </div>

        <button type="submit" className="submit-button">Complete Booking</button>
      </form>

      {formSubmitted && <p className="success-message">Booking submitted successfully!</p>}
    </div>
  );
};

export default BookingForm;
